function App() {
  return (
    <div>
      <Header />
      <Hero/>
      <InfoSection/>
      <div className="my-20"></div> {/* Espacement entre les deux sections */}
      <TourPackages />
      <Route path="/" element={<Services />} />
      <Route path="/destinations/chefchaouen" element={<Chefchaouen />} />
    </div>
  );
}

export default App;
